import Dropdown1 from "./Dropdown";
import Filteredchip from "./Filteredchip";

const Filter = () => {
  return (
    <div id="filter">
      <div id="filter-box" className="flex justify-between items-center">
        <Filteredchip />
      </div>
      <Dropdown />
    </div>
  );
};

export default Filter;
